PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_userprofile" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "avatar" varchar(255) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "instagram_data_folder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "instagram_data_instagrampost" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "url" varchar(500) NOT NULL, "user_posted" varchar(100) NOT NULL, "description" text NULL, "hashtags" text NULL, "num_comments" integer NOT NULL, "date_posted" datetime NULL, "likes" integer NOT NULL, "photos" text NULL, "videos" text NULL, "location" varchar(255) NULL, "latest_comments" text NULL, "discovery_input" varchar(255) NULL, "thumbnail" varchar(500) NULL, "content_type" varchar(50) NULL, "engagement_score" real NOT NULL, "tagged_users" text NULL, "followers" integer NULL, "posts_count" integer NULL, "profile_image_link" varchar(500) NULL, "is_verified" bool NOT NULL, "is_paid_partnership" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "folder_id" bigint NULL REFERENCES "instagram_data_folder" ("id") DEFERRABLE INITIALLY DEFERRED, "post_id" varchar(100) NOT NULL, "platform_type" varchar(50) NULL);
CREATE TABLE IF NOT EXISTS "track_accounts_trackaccountfolder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "track_accounts_trackaccount" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "iac_no" varchar(100) NOT NULL UNIQUE, "facebook_id" varchar(500) NULL, "instagram_id" varchar(500) NULL, "linkedin_id" varchar(500) NULL, "tiktok_id" varchar(500) NULL, "other_social_media" text NULL, "risk_classification" varchar(100) NULL, "close_monitoring" bool NOT NULL, "posting_frequency" varchar(100) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "folder_id" bigint NULL REFERENCES "track_accounts_trackaccountfolder" ("id") DEFERRABLE INITIALLY DEFERRED, "facebook_username" varchar(100) NULL, "instagram_username" varchar(100) NULL, "linkedin_username" varchar(100) NULL, "tiktok_username" varchar(100) NULL);
CREATE TABLE IF NOT EXISTS "track_accounts_reportfolder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "description" text NULL, "start_date" datetime NOT NULL, "end_date" datetime NOT NULL, "source_folders" text NULL, "total_posts" integer NOT NULL, "matched_posts" integer NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "track_accounts_reportentry" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NULL, "iac_no" varchar(100) NULL, "entity" varchar(255) NULL, "close_monitoring" varchar(5) NULL, "posting_date" datetime NULL, "platform_type" varchar(50) NULL, "post_url" varchar(500) NULL, "username" varchar(100) NULL, "account_type" varchar(100) NULL, "keywords" text NULL, "content" text NULL, "post_id" varchar(100) NULL, "track_account_id" integer NULL, "created_at" datetime NOT NULL, "report_id" bigint NOT NULL REFERENCES "track_accounts_reportfolder" ("id") DEFERRABLE INITIALLY DEFERRED, "sn" varchar(50) NULL);
CREATE TABLE IF NOT EXISTS "reports_report" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "description" text NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "facebook_data_folder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "facebook_data_facebookpost" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "url" varchar(500) NULL, "post_id" varchar(255) NULL, "user_url" varchar(500) NULL, "user_username_raw" varchar(255) NULL, "content" text NULL, "date_posted" datetime NULL, "hashtags" text NULL, "num_comments" integer NULL, "num_shares" integer NULL, "num_likes_type" varchar(255) NULL, "page_name" varchar(255) NULL, "profile_id" varchar(255) NULL, "page_intro" text NULL, "page_category" varchar(255) NULL, "page_logo" varchar(500) NULL, "page_external_website" varchar(500) NULL, "page_likes" integer NULL, "page_followers" integer NULL, "page_is_verified" bool NOT NULL, "original_post" text NULL, "attachments_data" text NULL, "other_posts_url" varchar(500) NULL, "post_external_link" varchar(500) NULL, "post_external_title" varchar(500) NULL, "post_external_image" varchar(500) NULL, "page_url" varchar(500) NULL, "header_image" varchar(500) NULL, "avatar_image_url" varchar(500) NULL, "profile_handle" varchar(255) NULL, "has_handshake" bool NOT NULL, "is_sponsored" bool NOT NULL, "sponsor_name" varchar(255) NULL, "shortcode" varchar(255) NULL, "video_view_count" integer NULL, "likes" integer NULL, "post_type" varchar(50) NOT NULL, "post_image" varchar(500) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "folder_id" bigint NULL REFERENCES "facebook_data_folder" ("id") DEFERRABLE INITIALLY DEFERRED, "user_posted" varchar(100) NULL, "description" text NULL, "content_type" varchar(50) NULL, "count_reactions_type" text NULL, followers INTEGER NULL, is_verified BOOLEAN DEFAULT 0, posts_count INTEGER NULL, profile_image_link VARCHAR(500) NULL, platform_type VARCHAR(50) NULL, location VARCHAR(255) NULL, latest_comments TEXT NULL, discovery_input VARCHAR(255) NULL, tagged_users TEXT NULL, page_phone VARCHAR(50) NULL, thumbnail VARCHAR(500) NULL, about TEXT NULL, is_paid_partnership BOOLEAN DEFAULT 0, engagement_score REAL DEFAULT 0.0, external_link VARCHAR(500) NULL, length REAL NULL, audio VARCHAR(100) NULL, days_range INTEGER NULL, num_of_posts INTEGER NULL, posts_to_not_include TEXT NULL, from_date DATE NULL, start_date DATE NULL, end_date DATE NULL, following INTEGER NULL, timestamp DATETIME NULL, active_ads_urls TEXT NULL, delegate_page_id VARCHAR(255) NULL, warning TEXT NULL, warning_code VARCHAR(100) NULL, error TEXT NULL, error_code VARCHAR(100) NULL, include_profile_data BOOLEAN NULL, is_page BOOLEAN NULL, link_description_text TEXT NULL, page_creation_time DATETIME NULL, page_email VARCHAR(255) NULL, page_price_range VARCHAR(50) NULL, page_reviewers_amount INTEGER NULL, page_reviews_score VARCHAR(20) NULL, until_date DATE NULL, input TEXT NULL, photos TEXT NULL, videos TEXT NULL);
