CREATE TABLE IF NOT EXISTS "linkedin_data_linkedinpost" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "url" varchar(500) NOT NULL, "user_posted" varchar(100) NOT NULL, "description" text NULL, "hashtags" text NULL, "num_comments" integer NOT NULL, "date_posted" datetime NULL, "likes" integer NOT NULL, "photos" text NULL, "videos" text NULL, "location" varchar(255) NULL, "latest_comments" text NULL, "post_id" varchar(100) NOT NULL, "discovery_input" varchar(255) NULL, "thumbnail" varchar(500) NULL, "content_type" varchar(50) NULL, "platform_type" varchar(50) NULL, "engagement_score" real NOT NULL, "tagged_users" text NULL, "followers" integer NULL, "posts_count" integer NULL, "profile_image_link" varchar(500) NULL, "is_verified" bool NOT NULL, "is_paid_partnership" bool NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "folder_id" bigint NULL REFERENCES "linkedin_data_folder" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tiktok_data_folder" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "description" text NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
