INSERT INTO instagram_data_instagrampost VALUES(2564,'https://www.instagram.com/p/DIa-qiUTCx5','danwhatuwan',replace('HereΓÇÖs a photo of me, receiving my first ever award during an agency townhall meeting back in 2017.\n\nA little bit of my journey leading up to that moment.\n\nAfter NS, I stepped into Insurance straight. I heard it''s sales and I can earn a lot of money, so why not? ≡ƒñ╖≡ƒÅ╗ΓÇìΓÖé∩╕Å\n\nBut I had my struggles in the initial 8 months. I was only earning $1.8k in total. I almost gave up (I was in debt during that time as well).\n\nLooking back, IΓÇÖm glad I didn''t give up. I feel that credit for my career breakthrough goes to both ΓÇ£perseveranceΓÇ¥ and ΓÇ£luckΓÇ¥. Breakthrough is something you have to be ready for, and when the element of luck comes, you break through. Breakthrough doesnΓÇÖt come ΓÇ£just like thatΓÇ¥ because you learn and worked hard.┬á\n\nSince then, warm cases started to come in and I earned my first $10k. Subsequently, sales were good and I even got married soon after ≡ƒÿä\n\nSo if you''re having a tough start or hesitating because you''re afraid of the hurdles, remember this: perseverance and readiness can turn even the smallest opportunity into a breakthrough. Keep pushing forward and your moment will come just like mine did!\n\n#careerjourney #nevergiveup #breakthrough #careersuccess #empowerment #personalgrowth #mentorship #financialadvisory #financialconsultant #financialservices','\n',char(10)),'["#careerjourney","#nevergiveup","#breakthrough","#careersuccess","#empowerment","#personalgrowth","#mentorship","#financialadvisory","#financialconsultant","#financialservices"]',0,'2025-04-14 09:13:40',38,'["https://instagram.fphl1-1.fna.fbcdn.net/v/t51.2885-15/491036114_18497680846032989_3714369024655680062_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=instagram.fphl1-1.fna.fbcdn.net&_nc_cat=105&_nc_oc=Q6cZ2QGbw7nEOXN_yWiXSGF2mw2W2Z86sRPz58qfY3jBZrgNF9oaZV4WTbpaj0Q6lUbGskQ&_nc_ohc=UoGhv84CuQoQ7kNvwHZd4nF&_nc_gid=IkUuhSlw1i