INSERT INTO instagram_data_instagrampost VALUES(2585,'https://www.instagram.com/p/DIbP0AXy1Yt','stevechenglc',replace('Part 1 \nΓ£¿ Take Responsibility for Our Own Success Γ£¿\n\nJust listened to the legendary Tony Gordon ΓÇö expelled from school at 16.\nWritten off by teachers. Doubted by friends.\nToday, at 79, he stands as one of the greatest icons in the insurance world.\nA true GOAT.\n\nHe ended his sharing with this powerful truth:\n\nΓÇ£Take responsibility for our own success.\nIf things arenΓÇÖt going our wayΓÇª\nIs it the companyΓÇÖs fault? Our managerΓÇÖs fault? Other peopleΓÇÖs fault?\nNOΓÇª HELL NO!ΓÇ¥\n\nThat hit deep.\n\nMy biggest takeaway?\nWeΓÇÖre not stuck.\nWeΓÇÖre not stone.\nWe can move.\nWe can change.\nWe can find solutions.\n\nΓÇ£We are not a stone. We can move.ΓÇ¥\n\nSo letΓÇÖs:\nΓ₧í∩╕Å Stop blaming\nΓ₧í∩╕Å Stop pointing fingers\nΓ₧í∩╕Å Keep moving\nΓ₧í∩╕Å Keep failing forward\nΓ₧í∩╕Å Keep growing\nΓ₧í∩╕Å Keep becoming better\n\nEvery get-up brings us higher.\nLetΓÇÖs keep climbing ΓÇö together.\n\nA very good reminder to self. - Part 1','\n',char(10)),'',0,'2025-04-14 11:43:31',4,'["https://scontent-mia3-3.cdninstagram.com/v/t51.2885-15/490195392_18340751749091084_1000186395686279481_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=scontent-mia3-3.cdninstagram.com&_nc_cat=108&_nc_oc=Q6cZ2QHmtGu4GmVwH71laoj5qREDWHTBNYVRnbH29XYBdyQUoqHfwYZq8t1MX3NR3sAcQgs&_nc_ohc=A1UwX6GtsJwQ7kNvwH4pJWt&_nc_gid=LmE1WTiwpDwGETf1RZPZUg&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfEfWrxxARL472OhxvFxIlusUWPL1Kfn6ailUY7fW0W92Q&oe=680BE520&_nc_sid=d885a2"]','','["KSL Esplanade Hotel"]','','{"url":"https://www.instagram.com/stevechenglc/","start_date":"2025-04-14","end_date":"2025-04-20","post_type":""}','https://scontent-mia3-3.cdninstagram.com/v/t51.2885-15/490195392_18340751749091084_1000186395686279481_n.jpg?stp=c0.31.1440.1440a_dst-jpg_e35_s640x640_sh0.08_tt6&_nc_ht=scontent-mia3-3.cdninstagram.com&_nc_cat=108&_nc_oc=Q6cZ2QHmtGu4GmVwH71laoj5qREDWHTBNYVRnbH29XYBdyQUoqHfwY