INSERT INTO instagram_data_instagrampost VALUES(2587,'https://www.instagram.com/p/DIbVB9fSi8Z','stevechenglc',replace('Part 2\nDisclaimer: not trying to be disrespectful to anyone. Pardon the AI effect. \n\nΓÇ£Sir, I just want to shake your hand.ΓÇ¥\n(He gave me a weird stareΓÇª and a gentle smack on the arm.)\n\nAfter listening to the legendary Tony GordonΓÇöthe GOAT of the insurance industryΓÇöshare his story, I was deeply inspired.\n\nAt 79, he flew from the US to Malaysia just to spend an hour with us. He couldΓÇÖve stayed in the comfort of home, or travelled with friends. But he chose to be hereΓÇöto give, to serve, to lift others. That alone taught me something: greatness doesnΓÇÖt retire.\n\nAfter his session, everyone rushed to take photos. I couldnΓÇÖt get close, so I cheekily ΓÇ£photo bombedΓÇ¥ and AI-ed myself closer in Photo 1.\n\nBut eventually, as the room cleared, we got a proper photo with him.\n\nThen came my moment.\nI walked up, extended my hand, and said:\nΓÇ£Sir, I just want to shake your hand.ΓÇ¥\n\nHe looked at me with a confused stareΓÇª then gave me a light smack on the arm.\n\nI wasnΓÇÖt trying to be cheeky or disrespectful.\nI just wanted to feel the warmth of his hand.\nTo remind myselfΓÇöheΓÇÖs human. Just like us.\nSame warmth. Same heart. Same opportunity to do something great with our lives.\n\nIΓÇÖm grateful for this journey.\nGrateful for the team and family weΓÇÖve built at PFG.\nAnd grateful even for the tough daysΓÇöbecause theyΓÇÖre shaping us for something greater.\n\nLetΓÇÖs keep going.\nBecause if he can, we can.\nIf he did, so can we.\n\nA good reminder to self. - Part 2','\n',char(10)),'',1,'2025-04-14 12:29:07',7,'["https://scontent.cdninstagram.com/v/t51.2885-15/491463109_18340757692091084_672039606788918314_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=scontent.cdninstagram.com&_nc_cat=108&_nc_oc=Q6cZ2QHYANo9V9bm_RZ7phhb1-6jpgz0w4Zy_NiA4CC2J5BALxndUafiwkWy30hh3-ZU--E&_nc_ohc=p2wYQ2UthWQQ7kNvwE7R9Nm&_nc_gid=WJjZ-EZKm