INSERT INTO instagram_data_instagrampost VALUES(2652,'https://www.instagram.com/p/DIi8kKISqqi','nicholasdamiengoh',replace('ItΓÇÖs easy to focus on results ΓÇö but real leadership is about who we become and how we care for the people around us.\n\n@chgvince reminded me that consistency isnΓÇÖt always loud ΓÇö but itΓÇÖs what builds trust over time.\n\n@jac6ie_226 demonstrates that real leadership begins with listening, not just leading.\n\n@augustineseah reveals that the best leaders think long-term, and build with intention.\n\nIΓÇÖm building a team that feels like family ΓÇö grounded in purpose, growth, discipline, unity, and gratitude. We show up, grow together, and celebrate the wins, big and small.\n\nFrom 2 June to 11 July 2025, IΓÇÖm opening up a paid internship for anyone curious about what I do and how this career works. If youΓÇÖre exploring options, or just want to learn something useful ΓÇö drop me a message.\n\nIf youΓÇÖve been searching for a place where you belong, grow, and lead with heart ΓÇö this might just be for you.\n\nLetΓÇÖs build something bigger ΓÇö together.\n\n#GohTheDistance','\n',char(10)),'["#GohTheDistance"]',0,'2025-04-17 11:29:15',61,'["https://instagram.fphl1-1.fna.fbcdn.net/v/t51.2885-15/491461100_18265708258285838_3492080400351056379_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=instagram.fphl1-1.fna.fbcdn.net&_nc_cat=102&_nc_oc=Q6cZ2QH2v2RHm2gPKWuaZQFz_bJJ07ZyF7lC86cEB0KL-23dH0L1Kzi0Zm4ft1SDwBOXl3k&_nc_ohc=gzyH8sVgqogQ7kNvwEi6jKJ&_nc_gid=3u_bUwlFFw_BwYA6fvVWPg&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfG1n6S3nFfKSpsFKnay4AJd-0-3kFsFg_ssizpZ77ZPDQ&oe=680BDC6F&_nc_sid=d885a2","https://instagram.fphl1-1.fna.fbcdn.net/v/t51.2885-15/490473487_18265708267285838_5486151863892372448_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=instagram.fphl1-1.fna.fbcdn.net&_nc_cat=102&_nc_oc=Q6cZ2QH2v2RHm2gPKWuaZQFz_bJJ07ZyF7lC86cEB0KL-23dH0L1Kzi0Zm4ft1SDwBOXl3k&_nc_ohc=YrIzhcpeoJ8Q7kNvwEN4gcl&_nc_gid=3u_bUwlFFw_BwYA6fvVWPg&edm=ANTKIIoBAAAA&ccb=7-5&oh