INSERT INTO instagram_data_instagrampost VALUES(2654,'https://www.instagram.com/p/DIi8qw6SF6Q','chengyen_ocy',replace('LifeΓÇÖs Little Divine Connections\n\nMet this young Indian lady recentlyΓÇösheΓÇÖs got a degree in Computer Science but is feeling stuck at a crossroad, unsure of her next step. From a total stranger, I had the chance to journey with her using the Enneagram and coaching card. It opened her eyes to the areas she can grow in, and gave her a clearer sense of direction.\n\nHonestly, it filled me with so much joy! Even though IΓÇÖm not from her industry, IΓÇÖm thankful I could contribute by helping her build clarity, confidence, and values to guide her decisions.\n\nAlso want to give a shoutout to my coach @lilianong73 whoΓÇÖs been such a strong support in my own growth. Through her 5-day challenge, I gained fresh perspective, strategy and direction in my recruitment efforts. She truly complements my weaknesses and gives me the push I need.\n\nWe even got to celebrate our birthdays togetherΓÇöand as her coachee, I had the privilege of using the coaching card @jensensiaw to bless her back with clarity and purpose in her current season.\n\nSo grateful for these divine appointments. Life is meaningful when we can pour what weΓÇÖve learned into others.\n\n#EnneagramJourney #CoachingMoments #PurposeDriven #WomenSupportingWomen #DivineConnections #GrowthTogether#eqworld','\n',char(10)),'["#EnneagramJourney","#CoachingMoments","#PurposeDriven","#WomenSupportingWomen","#DivineConnections","#eqworld"]',1,'2025-04-17 11:30:09',4,'["https://scontent-mia3-2.cdninstagram.com/v/t51.2885-15/490279635_18407156323096555_5464658131876801707_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=scontent-mia3-2.cdninstagram.com&_nc_cat=107&_nc_oc=Q6cZ2QEtFDAf4jkoImftvyn87jp-hzCzYj3_CGzVV2iB_YGdNQaFBahTZ_zVxY_Lek1G14U&_nc_ohc=WdZYYHtD9iEQ7kNvwGf7Gii&_nc_gid=MEFYgS7AgllsP6t279o7gA&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfEWcWnFXdidRqnMz2M2dKDNQ50hgsrXB3Qjb6HiuXDWcw&oe=680BE65A&_nc_sid=