INSERT INTO instagram_data_instagrampost VALUES(2661,'https://www.instagram.com/p/DIj0QAHTY1X','chanelundasanlee',replace('All glory to God. For His grace, strength, and divine appointments every step of the way.\n\n16 Years in the Business | 17 April 2025\n\nI was just 21 when I RNFΓÇÖd - wide-eyed, full of hope, with a simple dream: To make a real difference in peopleΓÇÖs lives, especially the ones I loved.\n\nI still remember what my leaderΓÇÖs mentor told me back then:\nΓÇ£If you do this right, with sincerity and service, youΓÇÖll never run out of people to help.ΓÇ¥\n\nBack then, I had no idea how deeply this journey would shape me. I just knew I wanted to be someone others could count on.\n\nFast forward 16 yearsΓÇª\n440 clients. Countless moments of courage, care, and conversation.\n\nStill here.\nStill growing.\nStill giving from the heart.\n\nGrateful for every person whoΓÇÖs been part of this story -\nClients who became friends, friends who became clients, mentors who saw more in me than I saw in myself and my tribe whoΓÇÖve stood by me through every season.\n\nHereΓÇÖs to the journey ahead.\nThe best is yet to come.\n\n#16YearsStrong #FinancialConsultant #WithHeart #MDRT #GELAC #LifeByDesign #GratefulJourney #WomenInFinance #AllGloryToGod','\n',char(10)),'["#16YearsStrong","#FinancialConsultant","#WithHeart","#MDRT","#GELAC","#LifeByDesign","#GratefulJourney","#WomenInFinance","#AllGloryToGod"]',1,'2025-04-17 19:35:50',14,'["https://scontent-mia3-1.cdninstagram.com/v/t51.2885-15/491462771_18503189746038227_3848675226344394046_n.jpg?stp=dst-jpg_e35_p1080x1080_sh0.08_tt6&_nc_ht=scontent-mia3-1.cdninstagram.com&_nc_cat=111&_nc_oc=Q6cZ2QEr6MFdI8UstoRE5f-qsnxZpINB9zVSAaojepLosN9fhfFBYE7K-dJ3gi8B2NMl7OY&_nc_ohc=ycn772Rz4QsQ7kNvwE8lSHQ&_nc_gid=MNNmEyXNOA7e6n1DsXhYPQ&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfEfvDf-zU1dL8jqJTk_Quv0Bzfibik1SkNlbgTi8bkpGw&oe=680BC550&_nc_sid=d885a2"]','','','[{"comments":"What an inspiration Chanel! Your calling is truly this for your have th