INSERT INTO instagram_data_instagrampost VALUES(2675,'https://www.instagram.com/p/DIbFclZyClJ/','advisorsclique_plg',replace('≡ƒºá What is a Lasting Power of Attorney (LPA)?\nAn LPA is a legal document that lets you appoint someone you trust to make decisions on your behalf if you lose mental capacity one day ΓÇö whether itΓÇÖs about your health, finances, or property.\n\nBack on 12 April 2025, PLG & @Advisory.Titans hosted an exclusive LPA awareness event to help more families plan ahead with peace of mind.\n\nShoutout to @iwanna_puay @binwei_ and @jefflowjy for making event a success!!! ≡ƒÿå\n\n≡ƒÄÑ HereΓÇÖs a quick look at how it went ΓÇö and good news, weΓÇÖre hosting another session real soon!\n\n≡ƒô⌐ Reach out to your Financial Advisor to reserve a slot or learn more about how to make your LPA today.\n\n#LPA #LastingPowerOfAttorney \n#FinancialPlanning \n#PLGAdvisoryTitan \n#PlanAhead #LegacyPlanning #Adulting101\n#patricklohgroup','\n',char(10)),'["#LPA","#LastingPowerOfAttorney","#FinancialPlanning","#PLGAdvisoryTitan","#PlanAhead","#LegacyPlanning","#Adulting101","#patricklohgroup"]',0,'2025-04-14 10:52:49',11,'','','','','{"url":"https://www.instagram.com/advisorsclique_plg/","start_date":"2025-04-14","end_date":"2025-04-20"}','https://instagram.fphl1-1.fna.fbcdn.net/v/t51.2885-15/490313242_18266697928279059_8688456897562253173_n.jpg?stp=c0.896.2304.2304a_dst-jpg_e35_s640x640_sh0.08_tt6&_nc_ht=instagram.fphl1-1.fna.fbcdn.net&_nc_cat=103&_nc_oc=Q6cZ2QG4qaKL18xjiTyQTZIujRIWT5oI1fzJ0tLWlhvD-YFTyFdi73l3O6FMlFUuOYFQHpw&_nc_ohc=Z9ruKwbkuYEQ7kNvwGEx5-2&_nc_gid=YlsQIXn-KXI-PMmqnaX1xw&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfEx4T4mhTVItq2jyfhVpTnrfU42AwBoKAay8JW5VAasjA&oe=680BC6AF&_nc_sid=d885a2','reel',0.0,'[{"full_name":"Jessica Lee","id":"316917206","is_verified":false,"profile_pic_url":"https://instagram.fphl1-1.fna.fbcdn.net/v/t51.2885-19/119230645_162919468756914_2477140108238162458_n.jpg?stp=dst-jpg_s150x150_tt6&_nc_ht=instagram.fphl1-1.fna.fbcdn.net&_nc_cat=106&_nc