INSERT INTO instagram_data_instagrampost VALUES(2684,'https://www.instagram.com/p/DIcClcrTzP6/','wyliewee',replace('[13 April 2025 | Bali, Indonesia]\n\nThis year, I made a spontaneous decision by booking a solo trip to Bali for my birthday. Behind the spontaneity was a quiet need for something more - more clarity, more courage, more connection with myself. The thought of being alone in an unfamiliar place can be intimidating. But thereΓÇÖs no one to distract me, from me. And in that silence, I started to listen. I listened moreΓÇöto the world around me and to myself. I noticed the little things: the art that spoke to me, dogs chasing waves, the sound of the ocean crashing onto shore. I confronted thoughts and feelings I usually drowned out with busyness. I learnt to appreciate my own pace, my own rhythm. I celebrated myself for the first time and celebrated with strangers who I may never meet again. And in all of that, I found a deep fulfilling sense of freedom ≡ƒ½╢≡ƒÅ╗','\n',char(10)),'',9,'2025-04-14 19:16:55',92,'','','','','{"url":"https://www.instagram.com/wyliewee/","start_date":"2025-04-14","end_date":"2025-04-20"}','https://scontent-atl3-1.cdninstagram.com/v/t51.2885-15/491088654_18502480477050812_9107023711082085676_n.jpg?stp=c0.874.2252.2252a_dst-jpg_e35_s640x640_sh0.08_tt6&_nc_ht=scontent-atl3-1.cdninstagram.com&_nc_cat=108&_nc_oc=Q6cZ2QGYH-fZCsYD_k8yXpZzBu7VPlxCQti-jBs5KzIddA5UFo6f4PWeyv6nYn9xTgQZttE&_nc_ohc=nBMeIzKVGrIQ7kNvwFNMgOo&_nc_gid=ngIS74Hporn5UnKqxV2r7w&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfEPNA0r1WinmfnfgPtVMFBMZn01CT0fuSww6_VRmN8_Kg&oe=680BC16D&_nc_sid=d885a2','reel',0.0,'[]',1273,432,'',0,0,'2025-04-30 12:06:34.742309','2025-04-30 12:06:34.742309',15,'3610772370749338618','IG Reel');
