INSERT INTO instagram_data_instagrampost VALUES(2686,'https://www.instagram.com/p/DIczHTUSKc7/','mageshdas',replace('Build a System for Sustainable Success\n\nSuccess isnΓÇÖt just about talent, hustle, or even luck. ItΓÇÖs about the systems you build around your goals.\n\nA good system gives you structure. It takes the guesswork out of your day. It keeps you consistent even when motivation fades.\n\nWhether itΓÇÖs your daily routine, your workflow, your fitness, or your client approachΓÇöbuild systems that support your long-term vision, not just your short-term wins.\n\nThe right system turns effort into results. It helps you grow, scale, and sustain success year after year.\n\nSet goals, but build systems.\nBecause systems donΓÇÖt rely on willpowerΓÇöthey rely on design.','\n',char(10)),'',0,'2025-04-15 02:11:45',6,'','','','','{"url":"https://www.instagram.com/mageshdas/","start_date":"2025-04-14","end_date":"2025-04-20"}','https://scontent-atl3-2.cdninstagram.com/v/t51.2885-15/487704845_1194095998925939_9073868763048255478_n.jpg?stp=c0.248.640.640a_dst-jpg_e15_tt6&_nc_ht=scontent-atl3-2.cdninstagram.com&_nc_cat=111&_nc_oc=Q6cZ2QEobuIWKvCT4p5eJ3GWgNIP1y1uzOAV-YHVt-4TfHgPrtVdYaU3-b3naF9AY1l7IJU&_nc_ohc=yxdsd6N0iKQQ7kNvwF6PSz_&_nc_gid=vlIW6G24Tz-P-xwB1Y13kA&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfGrQ7DK-WA6E0NNObrzx7eACg0Zm95GpmArSgJqHoITKQ&oe=680BE5E2&_nc_sid=d885a2','reel',0.0,'[]',770,517,'',0,0,'2025-04-30 12:06:34.754311','2025-04-30 12:06:34.754311',15,'3610985803394099003','IG Reel');
