INSERT INTO instagram_data_instagrampost VALUES(2688,'https://www.instagram.com/p/DId2iPavvlR/','benchoowj',replace('I walked into my 32nd year thinking it was going to be just another quiet birthdayΓÇª\nBut what unfolded was a humbling, heartwarming reminder of what truly matters in life. HereΓÇÖs what I learnt:\n\n≡¥ùú≡¥ù┐≡¥ù▓≡¥ÿÇ≡¥ù▓≡¥ù╗≡¥ù░≡¥ù▓ ≡¥ù╝≡¥ÿâ≡¥ù▓≡¥ù┐ ≡¥ù╜≡¥ù┐≡¥ù▓≡¥ÿÇ≡¥ù▓≡¥ù╗≡¥ÿü≡¥ÿÇ≡ƒÄüΓ£¿\nThe biggest impact wasnΓÇÖt from gifts, it was from the people who showed up. Being physically present, carving out time just to be there with me, was the most powerful form of love I couldΓÇÖve received. That kind of effort stays with you.\n\n≡¥ùÜ≡¥ù╢≡¥ÿâ≡¥ù▓ ≡¥ù│≡¥ù╢≡¥ù┐≡¥ÿÇ≡¥ÿü ≡¥ù»≡¥ù▓≡¥ù│≡¥ù╝≡¥ù┐≡¥ù▓ ≡¥ù▓≡¥ÿà≡¥ù╜≡¥ù▓≡¥ù░≡¥ÿü≡¥ù╢≡¥ù╗≡¥ù┤ ≡¥ÿü≡¥ù╝ ≡¥ù┐≡¥ù▓≡¥ù░≡¥ù▓≡¥ù╢≡¥ÿâ≡¥ù▓ ≡ƒñ¥\nIΓÇÖve never really planned birthday surprises for my wife. But after being on the receiving end of such a thoughtful gesture, it clicked. This is how good it feels to be loved intentionally.\nNow I find myself asking, ΓÇ£≡¥ÖÆ≡¥Ö¥≡¥Öû≡¥Ö⌐ ≡¥Öÿ≡¥Öû≡¥Öú ≡¥Öä ≡¥ÖÖ≡¥Öñ ≡¥Ö⌐≡¥Öñ ≡¥Öó≡¥Öû≡¥Öá≡¥ÖÜ ≡¥Ö¥≡¥ÖÜ≡¥Öº ≡¥ÖÖ≡¥Öû≡¥Ö« ≡¥Ö¿≡¥ÖÑ≡¥ÖÜ≡¥Öÿ≡¥Ö₧≡¥Öû≡¥Öí ≡¥Ö⌐≡¥Öñ≡¥Öñ?ΓÇ¥ Because love isnΓÇÖt just about feelingΓÇöitΓÇÖs about giving.\n\n≡¥ù£≡¥ÿüΓÇÖ≡¥ÿÇ ≡¥ù╗≡¥ù▓≡¥ÿâ≡¥ù▓≡¥ù┐ ≡¥ÿü≡¥ù╝≡¥ù╝ ≡¥ù╣≡¥ù«≡¥ÿü≡¥ù▓ ≡¥ÿü≡¥ù╝ ≡¥ÿÇ≡¥ÿü≡¥ù«≡¥ù┐≡¥ÿü ≡¥ù╣≡¥ù▓≡¥ù«≡¥ù┐≡¥ù╗≡¥ù╢≡¥ù╗≡¥ù┤≡ƒî▒\nIt took me 32 years to understand the power of gratitude.\nTo slow down, reflect, and truly appreciate the people around me. This birthday taught me to treat others how I want to be treated. Not just in big moments, but in the little ones too.\n\n≡¥ùÿ≡¥ÿâ≡¥ù▓≡¥ù╗ ≡¥ù┤≡¥ÿé≡¥ÿå≡¥ÿÇ ≡¥ù╗≡¥ù▓≡¥ù▓≡¥ù▒ ≡¥ùº≡¥ùƒ≡¥ùû≡ƒºí\nI used to think I didnΓÇÖt need the whole ΓÇ£tender loving careΓÇ¥ thing.\nBut truth isΓÇª IΓÇÖm human. And moments of real connection with friends, with loved ones matter. Friendship, camaraderie, and emotional support hit deeper than I expected. And IΓÇÖm grateful.\n\nHereΓÇÖs to 32 for the growth, the love, and the unexpected lessons that showed up in the most beautiful way. ≡ƒÖÅ','\n',char(10)),'',2,'2025-04-15 12:00:00',69,'','','','','{"url":"https://www.instagram.com/benchoowj/","start_date":"2025-04-14","end_date":"2025-04-20"}','https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/490755079_18502076935050243_5633606163218375057_n.jpg?stp=c0.1248.3216.3216a_dst-jpg_e35_s640x640_sh0.08_tt6&_nc_ht=scontent-sjc3-1.cdninstagram.com&_nc_cat=103&_nc_oc=Q6cZ2QF9KElEeXYcJyH3KOnhcSlYlmqXqn6SQJTPjWTJ0iobil7oklZYqSXiJFbmCkm9onk&_nc_ohc=nWvkwPKmUXIQ7kNvwHRA0oM&_nc_gid=dAR6Ag7EY_scpTkSByEymA&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfEl0wPOAJv71X3Xn6HO_bEeiZV8oT3z0ZLdOXt5vNvHww&oe=680BEB19&_nc_sid=d885a2','reel',0.0,'[{"full_name":"Vanessa Lim | Hustling Mama","id":"36007730","is_verified":false,"profile_pic_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-19/475632817_1106967367578273_2906334744783659203_n.jpg?stp=dst-jpg_s150x150_tt6&_nc_ht=scontent-sjc3-1.cdninstagram.com&_nc_cat=109&_nc_oc=Q6cZ2QF9KElEeXYcJyH3KOnhcSlYlmqXqn6SQJTPjWTJ0iobil7oklZYqSXiJFbmCkm9onk&_nc_ohc=WHavg2BYSn4Q7kNvwHl8qAl&_nc_gid=dAR6Ag7EY_scpTkSByEymA&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfF6-GG4chDZQ7ttnjG0gtoWJqSXIQh70ZwqBrGxS9_dJQ&oe=680BBCDE&_nc_sid=d885a2","username":"vantrucklorry"},{"full_name":"Timothy Tan | Senior Director","id":"8513714045","is_verified":false,"profile_pic_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-19/302143120_4832672396847933_5668675960412089108_n.jpg?stp=dst-jpg_s150x150_tt6&_nc_ht=scontent-sjc3-1.cdninstagram.com&_nc_cat=109&_nc_oc=Q6cZ2QF9KElEeXYcJyH3KOnhcSlYlmqXqn6SQJTPjWTJ0iobil7oklZYqSXiJFbmCkm9onk&_nc_ohc=ZvI9Qrn4tPoQ7kNvwGeCn9X&_nc_gid=dAR6Ag7EY_scpTkSByEymA&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfH0yE6ta4BeW6dPtqXKDbwlIOjMen8bSxeLRY0NUpDN5Q&oe=680BB8AD&_nc_sid=d885a2","username":"timothytanwy"},{"full_name":"Joie Lim","id":"187259864","is_verified":false,"profile_pic_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-19/475372897_980092447511191_1565848658756112915