INSERT INTO instagram_data_instagrampost VALUES(2756,'https://www.instagram.com/p/DInDgCMBy73/','alif_muhammad_nor',replace('Alhamdulillah. Yesterday we had the honour of hosting our loved ones for Raya.\n\nIt wasnΓÇÖt just an ordinary visit ΓÇö it held deep meaning for us.\n29 and 27 years ago, my wifeΓÇÖs parents left (passed away) her and her siblings at a young age.\nSince then, it was abang who stepped up ΓÇö carrying both roles ΓÇö always there to guide, support, and protect them like his own.\n\nBeing able to welcome him and his family into our home this Raya brought a different kind of warmth.\nSeeing the kids ΓÇö the cucus ΓÇö laughing, playing, and bonding so naturally made us feel as if Ayah and Ibu were with us too, smiling over the gathering.\n\nMoments like these remind me ΓÇö itΓÇÖs not about how grand the house is or how lavish the spread.\nItΓÇÖs about the barakah in the hearts that fill the space.\n\nAlhamdulillah for blessings that words sometimes cannot even describe.','\n',char(10)),'',0,'2025-04-19 01:56:18',8,'','','','','{"url":"https://www.instagram.com/alif_muhammad_nor/","start_date":"2025-04-14","end_date":"2025-04-20"}','https://scontent-iad3-2.cdninstagram.com/v/t51.2885-15/491460548_18503844469024139_4529006365678613488_n.jpg?stp=c0.127.320.320a_dst-jpg_e15_tt6&_nc_ht=scontent-iad3-2.cdninstagram.com&_nc_cat=111&_nc_oc=Q6cZ2QFfK5YzW-h8jx8cxmuSSH1TUWUw-rHzLCNOHL4tqS54tolBe4UeiXv0TLgcVyvojx4&_nc_ohc=A0hwuVw9KkQQ7kNvwHG7cSN&_nc_gid=ZD9jfqvBeJafucR3snn6kg&edm=ANTKIIoBAAAA&ccb=7-5&oh=00_AfFzrxFsWR1Bh3zlhZntVxTX0I-6OV5igzyjZZF-oCSyKg&oe=680BBD2F&_nc_sid=d885a2','reel',0.0,'[{"full_name":"Rusydi Rozalli","id":"708206938","is_verified":false,"profile_pic_url":"https://scontent-iad3-2.cdninstagram.com/v/t51.2885-19/491519662_18502496542046939_809083375951778545_n.jpg?stp=dst-jpg_s150x150_tt6&_nc_ht=scontent-iad3-2.cdninstagram.com&_nc_cat=111&_nc_oc=Q6cZ2QFfK5YzW-h8jx8cxmuSSH1TUWUw-rHzLCNOHL4tqS54tolBe4UeiXv0TLgcVyvojx4&_nc_ohc=5Xll9Y3FolgQ7kNv