INSERT INTO facebook_data_facebookpost VALUES(216,'https://www.facebook.com/reel/612263898465860/','1740697163495637.0','https://www.facebook.com/magesh.das.7','Magesh Das','Success isnΓÇÖt built on grand momentsΓÇöitΓÇÖs shaped by what you do daily. The key is knowing whatΓÇÖs non-negotiable: the habits that ground you, energize you, and keep you focused. Everything else? It can bend and adapt. You donΓÇÖt need a perfect routineΓÇöjust a consistent one that aligns with your goals. Show up, stay committed, and let the small wins compound. ThatΓÇÖs where real success begins.','2025-04-15 23:16:11',NULL,0,0,'{"type":"Like","num":3}','Magesh Das','100027000000000.0','https://youtu.be/EnNXjJhTnJU','Digital creator','https://scontent-atl3-2.xx.fbcdn.net/v/t39.30808-1/480328932_1700005737564780_5004853882126990591_n.jpg?stp=dst-jpg_s200x200_tt6&_nc_cat=102&ccb=1-7&_nc_sid=1d2534&_nc_ohc=8ZxtXbZGgzoQ7kNvwGRY8QO&_nc_oc=AdktgQU91XRmUBdQ5NL4psBo7AoDkxZrpht0UkOv-yS0gvvOAZ13BCtRGU4dIMP5-tk&_nc_zt=24&_nc_ht=scontent-atl3-2.xx&_nc_gid=coy4uKCShzHJ2rUhQJxBKg&oh=00_AfFR86n0z6OJXzUSAuEmoQELDvag5yo4FCngmTcukA-2eg&oe=680BD04E','Mad-success.myshopify.com',NULL,813,0,NULL,'[{"id":"612263898465860","type":"Video","url":"https://scontent-atl3-1.xx.fbcdn.net/v/t15.5256-10/491674164_2322057548195529_3868226555749172117_n.jpg?stp=dst-jpg_p296x100_tt6&_nc_cat=110&ccb=1-7&_nc_sid=282d23&_nc_ohc=xWevZ_xVC_sQ7kNvwE2Bcvd&_nc_oc=AdnmXKEKkfL-PdIO7SsjOJjYxA80mb8OzfpBhrtrdj20ol7lBJ_glKcbtjOzhLU-1Fk&_nc_zt=23&_nc_ht=scontent-atl3-1.xx&_nc_gid=qNmpeyd5D7NOSDsj1R13SA&oh=00_AfHIbOJcentW7_vojhYRhqb-T5OFVoy-6R5prZadWuc1vA&oe=680BC563","video_length":"56515","attachment_url":"https://www.facebook.com/reel/612263898465860/","video_url":"https://video-atl3-1.xx.fbcdn.net/o1/v/t2/f2/m69/AQNtv97a59wLnxTeXG0KzeRnD-dHZrLK0UcGEuxFkrqSkMvevk2s0Jmjlwpavz6SpgPm2UyX8wmI8_LUJhUC_sSK.mp4?strext=1&_nc_cat=106&_nc_sid=5e9851&_nc_ht=video-atl3-1.xx.fbcdn.net&_nc_ohc=6YWIMtz8-UEQ7kNvwEvf6m8&efg=eyJ2ZW5jb2RlX3RhZyI6Inhwdl9wc