INSERT INTO facebook_data_facebookpost VALUES(217,'https://www.facebook.com/reel/657123776930339/','1739970926901594.0','https://www.facebook.com/magesh.das.7','Magesh Das','Build a System for Sustainable SuccessSuccess isnΓÇÖt just about talent, hustle, or even luck. ItΓÇÖs about the systems you build around your goals.A good system gives you structure. It takes the guesswork out of your day. It keeps you consistent even when motivation fades.Whether itΓÇÖs your daily routine, your workflow, your fitness, or your client approachΓÇöbuild systems that support your long-term vision, not just your short-term wins.The right system turns effort into results. It helps you grow, scale, and sustain success year after year.Set goals, but build systems.Because systems donΓÇÖt rely on willpowerΓÇöthey rely on design.','2025-04-15 02:14:00',NULL,0,0,'{"type":"Like","num":1}','Magesh Das','100027000000000.0','https://youtu.be/EnNXjJhTnJU','Digital creator','https://scontent-atl3-2.xx.fbcdn.net/v/t39.30808-1/480328932_1700005737564780_5004853882126990591_n.jpg?stp=dst-jpg_s200x200_tt6&_nc_cat=102&ccb=1-7&_nc_sid=1d2534&_nc_ohc=8ZxtXbZGgzoQ7kNvwGRY8QO&_nc_oc=AdktgQU91XRmUBdQ5NL4psBo7AoDkxZrpht0UkOv-yS0gvvOAZ13BCtRGU4dIMP5-tk&_nc_zt=24&_nc_ht=scontent-atl3-2.xx&_nc_gid=coy4uKCShzHJ2rUhQJxBKg&oh=00_AfFR86n0z6OJXzUSAuEmoQELDvag5yo4FCngmTcukA-2eg&oe=680BD04E','Mad-success.myshopify.com',NULL,813,0,NULL,'[{"id":"657123776930339","type":"Video","url":"https://scontent-atl3-1.xx.fbcdn.net/v/t15.5256-10/491654874_1155156249694169_6070624710943404440_n.jpg?stp=dst-jpg_p296x100_tt6&_nc_cat=110&ccb=1-7&_nc_sid=282d23&_nc_ohc=sHnhG0ByDhMQ7kNvwH0S4IS&_nc_oc=Adlr7tsB1PW6g7b8wV4ORhp7N9ZmPv2YfKUntbZHUgHz3P3r8jFIraf-rwidG4NfHPI&_nc_zt=23&_nc_ht=scontent-atl3-1.xx&_nc_gid=qNmpeyd5D7NOSDsj1R13SA&oh=00_AfF435qnSNGh78rgM50LZKLOZOrqmxXNEOYygu4GCk44DQ&oe=680BC08D","video_length":"46421","attachment_url":"https://www.facebook.com/reel/657123776930339/","video_url":"https://video-atl3-1.xx.fbcdn.net/o1/v/