INSERT INTO facebook_data_facebookpost VALUES(226,'https://www.facebook.com/VijayDylanKumar/posts/pfbid02Un4zRXTC6Y1Do4gukED3itho3cu2qfAWDBPjWETaLD5WcYihuWsXYqHAAe77EPiWl','1.016084298123676e+16','https://www.facebook.com/VijayDylanKumar','Vijay Dylan Kumar',NULL,'2025-04-15 03:34:04',NULL,0,0,NULL,'Vijay Dylan Kumar','593856758.0','Financial Mindfulness Practitioner ~ Investor ~ Chartered Financial Consultant','Digital creator','https://scontent.fngo2-1.fna.fbcdn.net/v/t39.30808-1/275425773_10158369957066759_1910286924538671818_n.jpg?stp=c0.0.720.720a_dst-jpg_s200x200_tt6&_nc_cat=109&ccb=1-7&_nc_sid=1d2534&_nc_ohc=WIzrNiUFUcYQ7kNvwEUwJcs&_nc_oc=AdlWMeXnTHH7Xp3qqiOe6sn8o-XHdh1v3c2ByhyhNfl9MMgg0ToN71s5oDHbrzL9Hls&_nc_zt=24&_nc_ht=scontent.fngo2-1.fna&_nc_gid=VPRJ_2PexlUNvq0CpqwbWw&oh=00_AfFlOnlNUYL746EFgySqOQp3khRxForVe15o8xVGS1osqg&oe=680BD486','greateasternlife.com/sg/adviser/VIJAYAKUMAR',NULL,1100,0,'{"post_id":"UzpfSTEwMDA4MDI2MzUwNjI5OTo2ODQ5NDk1NjA4NTcxNTU6Njg0OTQ5NTYwODU3MTU1","post_url":"https://www.facebook.com/LostTemple7/posts/pfbid0GcFCpuVwUXC6H1LUTSg6T3xLntGBHaUcDyCTBfPgKuTQya8te1ddZ9s3bkTde7wLl","user_id":"100080263506299","user_url":"https://www.facebook.com/LostTemple7","user_name":"Lost Temples","date":"2025-04-14T04:01:06.000Z","content":"The 13th Century CE, Indian poet and saint Gyandev created a children''s game called Moksha Patam. The British later named it as Snakes and Ladders instead of retaining the original Moksha Patam.\n\nOriginally, the game was used as a part of moral instruction to children. The squares in which ladders start were each supposed to stand for a virtue, and those housing the head of a snake were supposed to stand for an evil. The snakes outnumbered the ladders in the original Hindu game. The game was transported to England by the colonial rulers in the latter part of the 19th Century CE, with some modifications.\n\nIn the original one, a ΓÇÿhundred squares game boardΓÇÖ, the 12th square was faith, the 51st square was reliability, the 57th square was generosity, the 76th square was knowledge, and the 78th square was asceticism. These were the squares where the ladders were found and one could move ahead faster.\n\nThe 41st square was for disobedience, the 44th square for arrogance, the 49th square for vulgarity, the 52nd square for theft, the 58th square for lying, the 62nd square for drunkenness, the 69th square for debt, the 84th square for anger, the 92nd square for greed, the 95th square for pride, the 73rd square for murder and the 99th square for lust. These were the squares where the snake waited with their mouth open.\n\nThe 100th square represented Nirvana or Moksha.The tops of each ladder depicted a God, or one of the various heavens (Kailash, Vaikunth , Brahmalok) and so on. As the game progressed various actions were supposed to take you up and down the board as in life..The game had been interpreted and used as a tool for teaching the effects of good deeds versus bad ones.\n\nThe game was popular in ancient India. It was also associated with traditional Sanatan philosophy contrasting karma and kama, or destiny and desire. It emphasized destiny, as opposed to games such as pachisi, which focused on life as a mixture of skill and luck. The underlying ideals of the game inspired a version introduced in Victorian England in 1892.\n\nThe modified game was named Snakes and Ladders and stripped of its moral and religious aspects and the number of ladders and snakes were equalized. In 1943, the game was introduced in the US under the name Chutes and Ladders.","attachments":[{"id":"684949534190491","type":"Photo","url":"https://scontent.fngo1-1.fna.fbcdn.net/v/t39.30808-6/490589449_684949537523824_547451744012386491_n.jpg?stp=dst-jpg_p526x296_tt6&_nc_cat=106&ccb=1-7&_nc_sid=833d8c&_nc_ohc=wr-v3wOQ5iwQ7kNvwFExmDF&_nc_oc=AdnayxGJCBrf-USj3zxlcZNnR7YE2jlUVApG-yMh787w_O1ujQOXuTYlJ8NMwgYGKI8&_nc_zt=23&_nc_ht=scontent.fngo1-1.fna&_nc_gid=0MIco2r8rr9jrGHz2tosEg&oh=00_AfFocSx30PEQNkaUKMYTjtouYhh2YrAt27g9ICs3pEdwGw&oe=680BE465"}]}',NULL,NULL,NULL,NULL,NULL,'https://www.facebook.com/VijayDylanKumar','https://scontent.fngo1-1.fna.fbcdn.net/v/t39.30808-6/475434063_10160602637606759_7340206168843842367_n.jpg?stp=dst-jpg_s960x960_tt6&_nc_cat=102&ccb=1-7&_nc_sid=cc71e4&_nc_ohc=i0jYXFS9Il4Q7kNvwErSR2H&_nc_oc=Adk3-_K5C4XgwlxcyzidbX51nnF9lKdtoNQFMrGtCBdWHa7kORG9LQPg6651hnAK0UI&_nc_zt=23&_nc_ht=scontent.fngo1-1.fna&_nc_gid=VPRJ_2PexlUNvq0CpqwbWw&oh=00_AfGlgStO9yAv98ORZDN3cpyOO4yk8JCuTkvVLBOmXQd_Ow&oe=680BD6CB','https://scontent.fngo2-1.fna.fbcdn.net/v/t39.30808-1/275425773_10158369957066759_1910286924538671818_n.jpg?stp=c0.0.720.720a_dst-jpg_s200x200_tt6&_nc_cat=109&ccb=1-7&_nc_sid=1d2534&_nc_ohc=WIzrNiUFUcYQ7kNvwEUwJcs&_nc_oc=AdlWMeXnTHH7Xp3qqiOe6sn8o-XHdh1v3c2ByhyhNfl9MMgg0ToN71s5oDHbrzL9Hls&_nc_zt=24&_nc_ht=scontent.fngo2-1.fna&_nc_gid=VPRJ_2PexlUNvq0CpqwbWw&oh=00_AfFlOnlNUYL746EFgySqOQp3khRxForVe15o8xVGS1osqg&oe=680BD486','VijayDylanKumar',0,0,NULL,'1.016084298123676e+16',NULL,0,'Post',NULL,'2025-04-30 09:45:43.555060','2025-04-30 09:51:11.901743',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0.0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
